import React from 'react';
import '../hoja-de-estilos/Footer.css';

const Footer = () => {
  return (
    <footer>
      <div className="contenedor-footer">
        <p>&copy; Derechos de Autor</p>
        <p>Jhonatan Gallego</p>
        <p>2024</p>
      </div>
    </footer>
  );
};

export default Footer;
